import styled from 'styled-components'
const Story = ({ story, removeStoriesHandler }) => {
  const Paragraph = styled.p`
    font-size: 20px;
    border: none;
    margin-left: 200px;
    display: flex;
    flex-direction: column;
    justify-content: start;
    font-family: 'Courier New', Courier, monospace;
    font-style: italic;
    cursor: pointer;
  `

  return (
    <>
      {story.map((el) => (
        <div key={el.id}>
          <Paragraph>
            {el.title} onClick=
            {(id) => {
              removeStoriesHandler(el.id)
            }}
          </Paragraph>
        </div>
      ))}
    </>
  )
}

export default Story
